import React from "react";
import "../../../../styles/book-blog/landing.scss";
const BookLanding = () => {
  return (
    <div id="landing">
      <h1>Thane's Book Blog</h1>
      <a href="/book-blog/books">
        <button type="button" class="btn btn-primary btn-lg btn-block my-0">
          Enter Site
        </button>
      </a>
    </div>
  );
};

export default BookLanding;
